import { AppBar, Button, Grid, TextField } from '@mui/material'
import { styled } from '@mui/material/styles';
import { borderRadius, Box, minHeight } from '@mui/system';
import React from 'react'
import Logo from './Logo.ico'





// Custom Textbox
const CTextField = styled(TextField)({

 
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: '#9B3C21',
      },
      '&:hover fieldset': {
        borderColor: '#9B3C21',
      },
  
    },
  });
  

const Login = () => {
  return (
    <div>

{/* Container Whole */}
      <Grid
      container
      spacing={0}
      direction="row"
      justifyContent="center"
      alignItems="stretch"
      style={
        {
          minHeight:'100vh'
        }
        }>

{/* Container Logo */}
          <Grid
          item 
          container
          direction="column"
          justifyContent="center"
          alignItems="center"
          xs={12} md={6}>


{/* Picture box */}       
            <Box
            fixed
            component='img'
            sx={{
              width: '80%',
              height: 'auto',
              maxHeight: { xs: 'auto', md: 'auto' },
              maxWidth: { xs: 200, md: '80%' },
            }}
            src={Logo} />
              
            </Grid>


{/* Container Login */}



            <Grid
            item 
            container
            direction="column"
            justifyContent="center"
            alignItems="center"
            xs={12} md={6}>

              {/* Container Box */}
              <Box
              sx={{
                width:400,
                height:600,
                backgroundColor: '#ffffff',
                maxHeight: { xs: '500', md: '400' },
                maxWidth: { xs: '350', md: '600' },
                border:"3px solid black",
                borderRadius:2
              }}>




              </Box>

              </Grid>



           

         

       </Grid>
    </div>
  )
}

export default Login
